import { useState } from "react";
import { useSelector } from "react-redux";
import { useLocation } from "react-router-dom";
import { Footer } from "../components/Footer";
import { Header } from "../components/Header";
import { MainBody } from "../components/MainBody";
import { popupBlock } from "../components/PopupBlock";
import { HomeSub } from "../components/subScreens/HomeSub";
import { MyListsSub } from "../components/subScreens/MyListsSub";
import { FiltersList } from "../locales/filters";
import { Filter } from "../models/Filter";

export const MyListsScr = () => {
  const { popup } = useSelector((state: any) => state.setPopup);
  return (
    <MainBody>
      {popupBlock({
        popup,
      })}
      <MyListsSub />
    </MainBody>
  );
};
